select 
	c.unique_account_id,
	c.current_customer_status,
	c.current_payment_status ,
	dcs.consecutive_late_days ,
	sum(p.amount) as amount_paid
from kenya.customer c
left join kenya.payment p on
	c.account_id = p.account_id and p.payment_utc_timestamp::DATE >= '20240416' and p.third_party_payment_ref_id not like 'BONUS%'
left join kenya.daily_customer_snapshot dcs on
	dcs.account_id = c.account_id and dcs.date_timestamp::DATE = current_date
